pragma solidity ^0.4.4;

contract Event {
  address public holder;
  string  public name;
  string  public location;
  string  public time;
  uint    public ticketNum = 0;
  uint    public ticketPrice;

  struct Attendee {
    string    first;
    string    last;
    string    email;
    bool      checkin;
  }

  mapping(address => Attendee) public Attendees;

  function Event(string _name, string _location,string _time, uint _ticketNum, uint _ticketPrice) public payable {
    // constructor
    require(bytes(_name).length != 0);
    require(bytes(_location).length != 0);
    require(bytes(_time).length != 0);
    require(_ticketNum != 0);
    require(_ticketPrice != 0);

    holder = msg.sender;
    name = _name;
    location = _location;
    time = _time;
    ticketNum = _ticketNum;
    ticketPrice = _ticketPrice;
  }

  function register(string _first, string _last, string _email) public payable {
    // constructor
    require(ticketNum - 1 >= 0);

    Attendee memory currentAttendee;
    currentAttendee.first = _first;
    currentAttendee.last = _last;
    currentAttendee.email = _email;
    currentAttendee.checkin = false;

    ticketNum = ticketNum - 1;
    Attendees[msg.sender] = currentAttendee;
  }

}
